  "inlineSchema": "// ðŸ• ZOR PIZZA - DATABASE SCHEMA\n// Bu fayl database strukturasini belgilaydi\n\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// ============================================\n// USER MODEL - Foydalanuvchilar\n// ============================================\nmodel User {\n  id       String   @id @default(uuid())\n  email    String   @unique\n  password String // Hashed password (bcrypt)\n  name     String\n  phone    String?\n  role     UserRole @default(CUSTOMER)\n\n  // Relationships\n  orders  Order[]\n  reviews Review[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"users\") // Database'da \"users\" table nomi\n}\n\nenum UserRole {\n  CUSTOMER // Oddiy mijoz\n  ADMIN // Administrator\n}\n\n// ============================================\n// CATEGORY MODEL - Kategoriyalar (Pizza, Ichimlik...)\n// ============================================\nmodel Category {\n  id          String  @id @default(uuid())\n  name        String  @unique\n  description String?\n  imageUrl    String?\n  isActive    Boolean @default(true)\n\n  // Relationships\n  products Product[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"categories\")\n}\n\n// ============================================\n// PRODUCT MODEL - Mahsulotlar (Pitsalar)\n// ============================================\nmodel Product {\n  id          String  @id @default(uuid())\n  name        String\n  description String\n  price       Float // Narx (so'm)\n  imageUrl    String?\n  prepTime    Int // Tayyorlanish vaqti (daqiqa)\n  isActive    Boolean @default(true)\n\n  // Relationships\n  categoryId String\n  category   Category @relation(fields: [categoryId], references: [id], onDelete: Cascade)\n\n  ingredients ProductIngredient[]\n  orderItems  OrderItem[]\n  reviews     Review[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"products\")\n}\n\n// ============================================\n// INGREDIENT MODEL - Ingredientlar\n// ============================================\nmodel Ingredient {\n  id          String @id @default(uuid())\n  name        String @unique\n  unit        String // kg, litr, dona\n  costPerUnit Float // Birlik narxi\n  stockQty    Float // Omborda miqdor\n  minStock    Float  @default(10) // Minimal stock (ogohlantirish uchun)\n\n  // Relationships\n  products ProductIngredient[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"ingredients\")\n}\n\n// ============================================\n// PRODUCT-INGREDIENT RELATION - Ko'pdan-ko'pga bog'lanish\n// ============================================\nmodel ProductIngredient {\n  id String @id @default(uuid())\n\n  productId String\n  product   Product @relation(fields: [productId], references: [id], onDelete: Cascade)\n\n  ingredientId String\n  ingredient   Ingredient @relation(fields: [ingredientId], references: [id], onDelete: Cascade)\n\n  quantity Float // Kerakli miqdor\n\n  @@unique([productId, ingredientId]) // Bir mahsulotda bir ingredient faqat bir marta\n  @@map(\"product_ingredients\")\n}\n\n// ============================================\n// ORDER MODEL - Buyurtmalar\n// ============================================\nmodel Order {\n  id          String @id @default(uuid())\n  orderNumber String @unique // rgba(2, 2, 57, 1), rgba(2, 2, 56, 1)... (user-friendly)\n\n  // Customer info\n  userId String\n  user   User   @relation(fields: [userId], references: [id])\n\n  // Order details\n  status        OrderStatus   @default(PENDING)\n  totalPrice    Float\n  paymentMethod PaymentMethod\n  paymentStatus PaymentStatus @default(PENDING)\n\n  // Delivery info\n  deliveryAddress String\n  deliveryPhone   String\n  deliveryLat     Float? // GPS koordinata\n  deliveryLng     Float?\n\n  estimatedTime Int? // Taxminiy yetkazish vaqti (daqiqa)\n\n  // Relationships\n  items   OrderItem[]\n  reviews Review[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"orders\")\n}\n\nenum OrderStatus {\n  PENDING // Kutilmoqda\n  CONFIRMED // Tasdiqlangan\n  PREPARING // Tayyorlanmoqda\n  READY // Tayyor\n  DELIVERING // Yetkazilmoqda\n  DELIVERED // Yetkazildi\n  CANCELLED // Bekor qilindi\n}\n\nenum PaymentMethod {\n  CASH // Naqd pul\n  CARD // Karta (Stripe)\n}\n\nenum PaymentStatus {\n  PENDING // Kutilmoqda\n  PAID // To'langan\n  FAILED // Xatolik\n  REFUNDED // Qaytarilgan\n}\n\n// ============================================\n// ORDER ITEM MODEL - Buyurtma elementlari\n// ============================================\nmodel OrderItem {\n  id String @id @default(uuid())\n\n  orderId String\n  order   Order  @relation(fields: [orderId], references: [id], onDelete: Cascade)\n\n  productId String\n  product   Product @relation(fields: [productId], references: [id])\n\n  quantity Int // Nechta\n  price    Float // O'sha paytdagi narx (tarih uchun)\n\n  @@map(\"order_items\")\n}\n\n// ============================================\n// REVIEW MODEL - Fikr-mulohazalar\n// ============================================\nmodel Review {\n  id String @id @default(uuid())\n\n  userId String\n  user   User   @relation(fields: [userId], references: [id])\n\n  orderId String @unique // Har bir buyurtma uchun faqat 1 ta review\n  order   Order  @relation(fields: [orderId], references: [id], onDelete: Cascade)\n\n  productId String? // Ixtiyoriy - muayyan mahsulot uchun review\n  product   Product? @relation(fields: [productId], references: [id])\n\n  rating  Int // 1-5 yulduz\n  comment String?\n\n  createdAt DateTime @default(now())\n\n  @@map(\"reviews\")\n}\n",
